import React from 'react';
import { Section, TextSection, Text } from '../../pages/Global/styles';

function InputData() {
    // Puxar do DB
    const store1 = {
        storeName: "Loja Fortaleza",
        storeNumber: 8001,
        accessCode: "temp"
    };
    const store2 = {
        storeName: "Loja São Paulo",
        storeNumber: 8002,
        accessCode: "temp"
    };
    const storesData = [store1, store2];

    return (
        <>
        {storesData.map((store) => (
            <Section>
                <TextSection><span>Loja {store.storeNumber}:</span></TextSection>
                <TextSection>{store.storeName}</TextSection>
                <Button>Teste</Button>
            </Section>
        ))}
        </>
    );
}

export default InputData;
